import express from "express";
import morgan from "morgan";
import globalRouter from "./routers/globalRouter";
import usersRouter from "./routers/userRouter";
import videosRouter from "./routers/videoRouter";

const PORT = 4000;

const app = express();
const logger = morgan("dev");
app.use(logger);

app.use("/", globalRouter);
app.use("/users", usersRouter);
app.use("/videos", videosRouter);

const handleListening = () =>
  console.log(`‚úÖ Server listening on port http://localhost:${PORT}ü¶î`);

app.listen(PORT, handleListening);

//Í∞ÅÍ∞Å ÎèÖÎ¶ΩÎêú Î¨∏ÏÑúÎ•º ÎßåÎì§Ïñ¥ export import Ìï¥ÏÑú Îçî ÍπîÎÅîÌïú ÏΩîÎìúÎ•º ÎßåÎì§Ïàò ÏûàÎã§

